import React from 'react'
import { AppPhone } from '../UI/AppPhone';
import { AppPhoneIcon } from '../UI/Icons/AppPhoneIcon';


export const FixedMenu = () => {
  return (
    <>
      <div className='d-flex justify-content-between'>
        <AppPhoneIcon />
        <AppPhone phone="+7 (495) 122-22-82" />
      </div>
    </>
  )
}
